import { GridList } from "@material-ui/core";
import { Component } from "react";
import Item from "../../components/cart-item/Item";

const tileData = ['test', 'test2'
];

class Home extends Component {

    render() {
        return (
            <div>
                <GridList cols={3}>
                    {
                        tileData.map(data =>
                            <li>{data}</li>
                        )
                    }
                </GridList>
            </div >
        );
    }
}

export default Home;
